import styled from 'styled-components'



export const Div = styled.div`
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    div{
      width: 100%;
    max-width: 400px;
    margin: 30px;
    border-radius: 5px;
    padding: 20px;

 section{
  justify-content: center;
 align-items: center;
 background-color: black;
 padding:10px;
 border-radius:5px;
 form{
  justify-content: center;
 align-items: center;
 input{
   border-radius:5px;
   padding:5px;
   margin:5px;
 }
 button{
   padding:5px;
   border-radius:5px;
   width:100px;
 }
 }
 }
}`;
